/*
FILENAME:     ResultsScreen.js
PURPOSE:      Last screen tp show to user on round completion
AUTHOR:       Eric Phung
CREATED:      10/26/2020 03:07 PM
*/
import React from 'react';
import {
  // Text,
  View,
  StyleSheet,
  Button,
} from 'react-native';

// shared components
import Heading from 'components/shared/Heading';
import Instructions from 'components/shared/Instructions';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'skyblue', // '#ecf0f1',
    padding: 8,
    paddingTop: 50,
  },
  text: {
    margin: 24,
    fontSize: 18,
    // fontWeight: 'bold',
    textAlign: 'center',
  },
});

function ResultsScreen({ navigation }) {
  const view = (
    <View style={styles.container}>
      <Heading title="You Finished!" />
      <Instructions title="Here are your results" />
      <View>
        <Button
          title="Go Back to Welcome Screen"
          onPress={() => navigation.navigate('Welcome')}
        />
      </View>
    </View>
  );
  return view;
}

export default ResultsScreen;
